import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Bonjour, Je suis Robin Pautigny - étudiant en 3ème année à Hetic.
Je m’intéresse aux nouvelles technologies, aux voitures ainsi qu’au marketing. Actuellement à la recherche d’un stage en tant que Chef de projet digital.</h3 >
      </header>
    </div>
  );
}

export default App;
